import React,{Component} from 'react';
import { Badge } from "antd";
import { LikeOutlined,CommentOutlined } from "@ant-design/icons";
class CardFooter extends Component{
    render(){
        return(
            <div className="card-footer">
                        <p>
                        <Badge count={5}>
                            <LikeOutlined />
                        </Badge>
                        </p>
                        <p>
                        <Badge count={5}>
                            <CommentOutlined  />
                        </Badge>
                        </p>

            </div>
        )
    }
}

export default CardFooter;
